@MarkDortch reported

>When I tried to open the new RECOVERY GUI for the case Recov.trp, I got an error saying an error generated by the surface water model GUI is preventing you from proceeding.

@u4epwjg9 thought there might be a problem with the handshake between the GUI and the model. For Tier 1, TREECS calls the GUI with a "/RUN" parameter so it passes through to the model.
